import React, { useState } from 'react';
import Button from '@mui/material/Button';
import Dialog from '@mui/material/Dialog';
import DialogTitle from '@mui/material/DialogTitle';
import DialogContent from '@mui/material/DialogContent';
import DialogActions from '@mui/material/DialogActions';
import TextField from '@mui/material/TextField';
import Typography from '@mui/material/Typography';
import Box from '@mui/material/Box';

export default function LeaguesPage() {
  const [openLogin, setOpenLogin] = useState(false);
  const [openRegister, setOpenRegister] = useState(false);
  const [loginEmail, setLoginEmail] = useState('');
  const [loginPassword, setLoginPassword] = useState('');
  const [registerEmail, setRegisterEmail] = useState('');
  const [registerPassword, setRegisterPassword] = useState('');
  const [registerName, setRegisterName] = useState('');
  const [loginError, setLoginError] = useState('');
  const [registerError, setRegisterError] = useState('');

  // Login handler
  const handleLogin = async () => {
    setLoginError('');
    try {
      const res = await fetch('http://localhost:8080/api/login', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ email: loginEmail, password: loginPassword })
      });
      if (!res.ok) throw new Error('Invalid credentials');
      // Aquí puedes guardar el token o usuario en localStorage/context
      setOpenLogin(false);
      setLoginEmail('');
      setLoginPassword('');
    } catch (err) {
      setLoginError('Invalid email or password');
    }
  };

  // Register handler
  const handleRegister = async () => {
    setRegisterError('');
    try {
      const res = await fetch('http://localhost:8080/api/register', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ name: registerName, email: registerEmail, password: registerPassword })
      });
      if (!res.ok) throw new Error('Registration failed');
      setOpenRegister(false);
      setRegisterEmail('');
      setRegisterPassword('');
      setRegisterName('');
      setOpenLogin(true); // Abrir login tras registro
    } catch (err) {
      setRegisterError('Registration failed');
    }
  };

  return (
    <Box sx={{ padding: 2 }}>
      <Typography variant="h5" gutterBottom>Leagues Page</Typography>
      <Button variant="contained" color="primary" onClick={() => setOpenLogin(true)}>
        Sign In
      </Button>

      {/* Login Modal */}
      <Dialog open={openLogin} onClose={() => setOpenLogin(false)}>
        <DialogTitle>Sign In</DialogTitle>
        <DialogContent>
          <TextField
            autoFocus
            margin="dense"
            label="Email"
            type="email"
            fullWidth
            value={loginEmail}
            onChange={e => setLoginEmail(e.target.value)}
          />
          <TextField
            margin="dense"
            label="Password"
            type="password"
            fullWidth
            value={loginPassword}
            onChange={e => setLoginPassword(e.target.value)}
          />
          {loginError && <Typography color="error">{loginError}</Typography>}
        </DialogContent>
        <DialogActions sx={{ flexDirection: 'column', alignItems: 'stretch' }}>
          <Button onClick={handleLogin} variant="contained" color="primary" fullWidth>Sign In</Button>
          <Button onClick={() => { setOpenLogin(false); setOpenRegister(true); }} color="secondary" fullWidth>
            Register
          </Button>
        </DialogActions>
      </Dialog>

      {/* Register Modal */}
      <Dialog open={openRegister} onClose={() => setOpenRegister(false)}>
        <DialogTitle>Register</DialogTitle>
        <DialogContent>
          <TextField
            autoFocus
            margin="dense"
            label="Name"
            type="text"
            fullWidth
            value={registerName}
            onChange={e => setRegisterName(e.target.value)}
          />
          <TextField
            margin="dense"
            label="Email"
            type="email"
            fullWidth
            value={registerEmail}
            onChange={e => setRegisterEmail(e.target.value)}
          />
          <TextField
            margin="dense"
            label="Password"
            type="password"
            fullWidth
            value={registerPassword}
            onChange={e => setRegisterPassword(e.target.value)}
          />
          {registerError && <Typography color="error">{registerError}</Typography>}
        </DialogContent>
        <DialogActions sx={{ flexDirection: 'column', alignItems: 'stretch' }}>
          <Button onClick={handleRegister} variant="contained" color="primary" fullWidth>Register</Button>
          <Button onClick={() => { setOpenRegister(false); setOpenLogin(true); }} color="secondary" fullWidth>
            Sign In
          </Button>
        </DialogActions>
      </Dialog>
    </Box>
  );
}
